import React from 'react'
import { useAuth } from './context/AuthContext'
import { useNavigate } from 'react-router-dom';
function Home() {

  fun




    const navigate = useNavigate();;
    const { user, logout } = useAuth();
    const handleLogOut = () =>{
        logout();
        navigate("/")
    }
  return (
    <div className='relative'>Welcome

        <h1>{user?.name}</h1>
        <p>{user?.role}</p>
        {user?.role ==="administrador" && <button className='absolute top-0 right-0 px-4 py-2 rounded bg-blue-500'>Añadir película</button>}
        <button className='bg-black text-white px-4 py-2 rounded' onClick={handleLogOut}>SALIR</button>
    </div>
  )
}

export default Home
